// SPDX-License-Identifier: MIT
pragma solidity 0.8.13;

contract MyContract{

    //create a structure ticket
    struct Ticket {
        address buyer;
        uint numbers;
        uint powerball;
    }

    address[] users; //user list
    Ticket[] tickets; //user's tickets
    bool active; //true if a round is active, false otherwise
    address lottery_manager; //lottery manager address
    uint ticket_price = 1000000000000000000; //1 eth

    constructor() public payable{
       active = true;
       lottery_manager = msg.sender;
    }

    function startNewRound() public{
        require(lottery_manager == msg.sender, "You're not the lottery manager");
        if(active == false)
        {
            active = true;
        }
    }

    function buy(uint _numbers, uint _powerball) public payable{

        //check if the round is active
        require(active == true, "Lottery closed");

        //check if the value is enough to buy a ticket
        uint money = msg.value;
        require(money >= ticket_price, "Value too small");

        //check if the numbers are ok

        //create an istance of ticket type
        Ticket memory ticket = Ticket({buyer : msg.sender, numbers : _numbers, powerball : _powerball});
        tickets.push(ticket);

        //give the change to owner
        if(money > ticket_price)
            payable(msg.sender).transfer(money - ticket_price);
    }

    function drawNumbers() public{
        //include an ethereum random service
        require(lottery_manager == msg.sender, "You're not the lottery manager");
    }

    function givePrizes() public{
        require(lottery_manager == msg.sender, "You're not the lottery manager");
    }

    function mint() public{
        require(lottery_manager == msg.sender, "You're not the lottery manager");
    }

    function closeLottery() public{
        require(lottery_manager == msg.sender, "You're not the lottery manager");
        if(active == true)
        {
            active = false;
        }

        //resetta le strutture
    }
}

